import React from 'react'

function FormHeader(props) {
    const {h1,values,...rest}=props;
    return (
       <h1 className="text-3xl font-medium text-yellow-500 uppercase flex justify-center">
           {h1}
          {values}
       </h1>
    )
}

export default FormHeader
